class KlineViewController: UIViewController {

  func bindEvents() {

    $symbol.combineLatest($interval)
      .sink { [weak self] _ in
        guard let self = self else { return }
        print("[kl] unsubscribe: \(self.symbol), \(self.interval.title)")
        BinanceWS.shared.unsubscribeKline(self.symbol, self.interval.value)
      }
      .store(in: &cancellables)

    $symbol.combineLatest($interval)
      .debounce(for: .seconds(0.25), scheduler: DispatchQueue.main)
      .map { sym, int in
        URLSession.shared.dataTaskPublisher(for: URL(string: "https://api.binance.com/api/v3/klines?symbol=\(sym.uppercased())&interval=\(int.value)")!)
          .map { $0.data }
          .replaceError(with: Data())
//        Just(Data(binance_json.utf8))
      }
      .switchToLatest()
      .receive(on: DispatchQueue.main)
      .sink { [weak self] data in
        guard let self = self else { return }
        guard !data.isEmpty else { return }
        //let str = String(decoding: data, as: UTF8.self)
        print("[kl] http: \(data.count)")
        self.datas = JSON(data).arrayValue.map { KlineData($0) }
        self.reset()
        self.subscribeWebSocket(self.symbol, self.interval)
      }
      .store(in: &cancellables)

    $primary.combineLatest($secondary)
      .dropFirst()
      .debounce(for: .seconds(0.25), scheduler: DispatchQueue.main)
      .sink { [weak self] _ in
        guard let self = self else { return }
        print("[kl] change chart")
        self.reset()
      }
      .store(in: &cancellables)

  }

  func subscribeWebSocket(_ sym: String, _ int: Interval) {
    print("[kl] subscribe: \(sym) \(int.title)")
    BinanceWS.shared.subscribeKline(sym, int.value)
      .sink { [weak self] model in
        guard let self = self else { return }
        if let index = self.datas.firstIndex(where: { $0.begin == model.begin }) {
          self.datas[index] = model
          print("[kl] got update \(self.datas.count)")
        } else {
          self.datas.append(model)
          print("[kl] got new \(self.datas.count)")
        }
        self.klineView.addData(model)
      }
      .store(in: &cancellables)
  }

  var datas: [KlineData] = []

  func reset() {
    klineView.erase()

    let pc: KlineChart
    switch interval {
    case .timeline:
      pc = TimelineChart()
    default:
      switch primary {
      case .ma:
        pc = MAChart()
      case .ema:
        pc = EMAChart()
      case .boll:
        pc = BOLLChart()
      }
    }
    pc.decimals = decimals

    let sc: KlineChart
    switch secondary {
    case .vol:
      sc = VOLChart()
      sc.decimals = 4
    case .macd:
      sc = MACDChart()
      sc.decimals = 2
    case .kdj:
      sc = KDJChart()
      sc.decimals = 2
    case .rsi:
      sc = RSIChart()
      sc.decimals = 2
    }

    klineView.resetDatas(datas, decimals, pc, sc)
  }



  override func viewDidLoad() {
    super.viewDidLoad()
    view.backgroundColor = .white

    view.addSubview(intervalView)
    intervalView.addSubview(intervalStack)
    intervalBtns.forEach { intervalStack.addArrangedSubview($0) }
    intervalView.snp.remakeConstraints { make in
      make.leading.equalToSuperview()
      make.trailing.equalToSuperview()
      make.top.equalTo(view.safeAreaLayoutGuide).offset(50)
      make.height.equalTo(30)
    }
    intervalStack.snp.remakeConstraints { make in
      make.leading.equalToSuperview().offset(10)
      make.top.bottom.equalToSuperview()
    }

    view.addSubview(klineView)
    klineView.snp.remakeConstraints { make in
      make.leading.trailing.equalTo(intervalView)
      make.top.equalTo(intervalView.snp.bottom)
    }

    view.addSubview(typeView)
    typeView.addSubview(primaryStack)
    primaryBtns.forEach { primaryStack.addArrangedSubview($0) }
    typeView.addSubview(secondaryStack)
    secondaryBtns.forEach { secondaryStack.addArrangedSubview($0) }
    typeView.snp.remakeConstraints { make in
      make.leading.trailing.equalTo(intervalView)
      make.top.equalTo(klineView.snp.bottom)
      make.height.equalTo(30)
    }
    primaryStack.snp.remakeConstraints { make in
      make.leading.equalToSuperview().offset(10)
      make.top.bottom.equalToSuperview()
    }
    secondaryStack.snp.remakeConstraints { make in
      make.trailing.equalToSuperview().offset(-10)
      make.top.bottom.equalToSuperview()
    }

    view.addSubview(symbolStack)
    symbolBtns.forEach { symbolStack.addArrangedSubview($0) }
    symbolStack.snp.remakeConstraints { make in
      make.centerX.equalToSuperview()
      make.top.equalTo(typeView.snp.bottom).offset(30)
      make.height.equalTo(30)
    }

    reloadViews()

    bindEvents()
  }

  lazy var klineView: KlineView = {
    let ret = KlineView()
    ret.setup()
    return ret
  }()

  enum Interval: Int, CaseIterable {
    case timeline
    case range_1m
    case range_15m
    case range_1h
    case range_1d
    var title: String {
      switch self {
      case .timeline: return "TL"
      case .range_1m: return "1m"
      case .range_15m: return "15m"
      case .range_1h: return "1h"
      case .range_1d: return "1d"
      }
    }
    var value: String {
      switch self {
      case .timeline: return "1m"
      case .range_1m: return "1m"
      case .range_15m: return "15m"
      case .range_1h: return "1h"
      case .range_1d: return "1d"
      }
    }
  }
  @Published var interval: Interval = .range_1m
  lazy var intervalView: UIView = {
    let ret = UIView()
    ret.backgroundColor = UIColor.brown.withAlphaComponent(0.2)
    return ret
  }()
  lazy var intervalStack: UIStackView = {
    let ret = UIStackView()
    ret.axis = .horizontal
    ret.alignment = .fill
    ret.distribution = .equalSpacing
    ret.spacing = 10
    return ret
  }()
  lazy var intervalBtns: [UIButton] = Interval.allCases.map {
    let btn = UIButton(type: .custom)
    btn.tag = $0.rawValue
    btn.titleLabel?.font = UIFont.systemFont(ofSize: 12)
    btn.setTitle($0.title, for: .normal)
    btn.setTitleColor(.lightGray, for: .normal)
    btn.setTitleColor(.black, for: .highlighted)
    btn.setTitleColor(.black, for: .disabled)
    btn.addTarget(self, action: #selector(intervalAction), for: .touchUpInside)
    return btn
  }
  @objc func intervalAction(_ sender: UIButton) {
    if let type = Interval(rawValue: sender.tag) {
      interval = type
      reloadViews()
    }
  }

  lazy var typeView: UIView = {
    let ret = UIView()
    ret.backgroundColor = UIColor.brown.withAlphaComponent(0.2)
    return ret
  }()

  enum Primary: Int, CaseIterable {
    case ma
    case ema
    case boll
    var title: String {
      switch self {
      case .ma: return "MA"
      case .ema: return "EMA"
      case .boll: return "BOLL"
      }
    }
  }
  @Published var primary: Primary = .ma
  lazy var primaryStack: UIStackView = {
    let ret = UIStackView()
    ret.axis = .horizontal
    ret.alignment = .fill
    ret.distribution = .equalSpacing
    ret.spacing = 10
    return ret
  }()
  lazy var primaryBtns: [UIButton] = Primary.allCases.map {
    let btn = UIButton(type: .custom)
    btn.tag = $0.rawValue
    btn.titleLabel?.font = UIFont.systemFont(ofSize: 12)
    btn.setTitle($0.title, for: .normal)
    btn.setTitleColor(.lightGray, for: .normal)
    btn.setTitleColor(.black, for: .highlighted)
    btn.setTitleColor(.black, for: .disabled)
    btn.addTarget(self, action: #selector(primaryAction), for: .touchUpInside)
    return btn
  }
  @objc func primaryAction(_ sender: UIButton) {
    if let type = Primary(rawValue: sender.tag) {
      primary = type
      reloadViews()
    }
  }

  enum Secondary: Int, CaseIterable {
    case vol
    case macd
    case kdj
    case rsi
    var title: String {
      switch self {
      case .vol: return "VOL"
      case .macd: return "MACD"
      case .kdj: return "KDJ"
      case .rsi: return "RSI"
      }
    }
  }
  @Published var secondary: Secondary = .vol
  lazy var secondaryStack: UIStackView = {
    let ret = UIStackView()
    ret.axis = .horizontal
    ret.alignment = .fill
    ret.distribution = .equalSpacing
    ret.spacing = 10
    return ret
  }()
  lazy var secondaryBtns: [UIButton] = Secondary.allCases.map {
    let btn = UIButton(type: .custom)
    btn.tag = $0.rawValue
    btn.titleLabel?.font = UIFont.systemFont(ofSize: 12)
    btn.setTitle($0.title, for: .normal)
    btn.setTitleColor(.lightGray, for: .normal)
    btn.setTitleColor(.black, for: .highlighted)
    btn.setTitleColor(.black, for: .disabled)
    btn.addTarget(self, action: #selector(secondaryAction), for: .touchUpInside)
    return btn
  }
  @objc func secondaryAction(_ sender: UIButton) {
    if let type = Secondary(rawValue: sender.tag) {
      secondary = type
      reloadViews()
    }
  }

  let symbols = ["ethusdt", "shibusdt"]
  @Published var symbol = "ethusdt"
  var decimals: Int { symbol.hasPrefix("shib") ? 6 : 4 }
  lazy var symbolStack: UIStackView = {
    let ret = UIStackView()
    ret.axis = .horizontal
    ret.alignment = .fill
    ret.distribution = .equalSpacing
    ret.spacing = 15
    return ret
  }()
  lazy var symbolBtns: [UIButton] = symbols.enumerated().map {
    let btn = UIButton(type: .custom)
    btn.tag = $0.offset
    btn.titleLabel?.font = UIFont.systemFont(ofSize: 14)
    btn.setTitle($0.element, for: .normal)
    btn.setTitleColor(.lightGray, for: .normal)
    btn.setTitleColor(.black, for: .highlighted)
    btn.setTitleColor(.black, for: .disabled)
    btn.addTarget(self, action: #selector(symbolAction), for: .touchUpInside)
    return btn
  }
  @objc func symbolAction(_ sender: UIButton) {
    let i = sender.tag
    if i >= 0 && i < symbols.count {
      symbol = symbols[i]
    }
    reloadViews()
  }

  func reloadViews() {
    intervalBtns.forEach {
      $0.isEnabled = $0.tag != interval.rawValue
    }
    primaryBtns.forEach {
      $0.isEnabled = $0.tag != primary.rawValue
    }
    secondaryBtns.forEach {
      $0.isEnabled = $0.tag != secondary.rawValue
    }
    symbolBtns.forEach {
      $0.isEnabled = symbols[$0.tag] != symbol
    }
  }

  lazy var cancellables = Set<AnyCancellable>()
}
